css:
@-moz-document domain("valenciacollege.edu") {
body {
    background-color: #202020;
    color: #eeeeee;
    background-image: unset;
}
body, div, p, th, td, li, dd {
    color: #eeeeee;
}

.bgcolor_1 {
    background-color: #404040;
}
.bgcolor_3 {
    background-color: #303030;
}

#container, #containerContent, #wrapper{
    background-color: #303030;
    color: #eeeeee;
}

#content tr.odd {
    background-color: #202020;
}

#left-col ul, #left-col ul, #left-col ul ul ul, #left-col ul ul {
    background-color: #202020;
    color: #dddddd;
}

#left-col ul li a {
    color: #dddddd;
}

.dk_gray {
    background-color: #303030;
}

#rightColumn {
    border: #0b0b0b 1px solid;
    background-color: #262626;
}

div.oitPanes div.tabArea {
    background-color: #343737;
    color: #cccccc;
}

ul.oitTabs a {
    background-color: #242424;
    color: #dedfa6;
}

.event_item a {
    color: #e1e0e0;
}

.bigText {
    color: #f4f4f4;
}

.Navigation, .navhead {
    background: #131313;
    color: #dddddd;
}
.btmSpacer {
    background: #131313;
    border-top: solid 1px #333;
}
.Group {
    background-color: #131313;
    border-top: solid 1px #333;
    color: #eeeeee;
}
a:link, a:visited, a:active {
    color: #eeeeee;
}
.Navigation a:visited, .Navigation a:link {
    color: #e1dfdf;
}
}
